      out.write("\t\t\t\t$(document).on('keypress', '#data_table_notes td:nth-child(3)', function(event) {\r\n");
      out.write("\t\t\t\t    // Get the character code of the pressed key\r\n");
      out.write("\t\t\t\t    var charCode = (event.which) ? event.which : event.keyCode;\r\n");
      out.write("\t\t\t\t\r\n");
      out.write("\t\t\t\t    // Allow only digits and a single decimal point\r\n");
      out.write("\t\t\t\t    if (charCode != 46 && charCode > 31 && (charCode < 48 || charCode > 57)) {\r\n");
      out.write("\t\t\t\t        event.preventDefault();\r\n");
      out.write("\t\t\t\t    }\r\n");
      out.write("\t\t\t\t\r\n");
      out.write("\t\t\t\t    // Allow only one decimal point\r\n");
      out.write("\t\t\t\t    if (charCode == 46 && $(this).text().indexOf('.') !== -1) {\r\n");
      out.write("\t\t\t\t        event.preventDefault();\r\n");
      out.write("\t\t\t\t    }\r\n");
      out.write("\t\t\t\t\r\n");
      out.write("\t\t\t\t    // Limit the note to between 0 and 20\r\n");
      out.write("\t\t\t\t    var newNote = parseFloat($(this).text() + String.fromCharCode(charCode));\r\n");
      out.write("\t\t\t\t    if (newNote < 0 || newNote > 20) {\r\n");
      out.write("\t\t\t\t        event.preventDefault();\r\n");
      out.write("\t\t\t\t    }\r\n");
      out.write("\t\t\t\t    \r\n");
      out.write("\t\t\t\t    // If Enter key is pressed, prevent default behavior and trigger submit button click event\r\n");
      out.write("\t\t\t\t    if (charCode == 13) {\r\n");
      out.write("\t\t\t\t        event.preventDefault();\r\n");
      out.write("\t\t\t\t        $('#submit_notes_btn').click();\r\n");
      out.write("\t\t\t\t    }\r\n");
      out.write("\t\t\t\t});\r\n");
